import React,{ useState } from "react";

const Header = () => {
    return (
        <div class="box__header-container">
        <div class="box__header box__header--dark"><div class="box__header-inner" style="background-color: rgb(88, 85, 226);"><div class="box__header-content"><button type="button" class="button__back" data-montelena-acode="200004333"><span class="for-a11y">뒤로 가기</span></button><div class="box__header-title"><h1 class="box__title" data-montelena-acode="200004334"><a href="https://m.gmarket.co.kr/?sectionSeq=3&amp;pageTypeSeq=2" class="link__logo"><img src="//script.gmarket.co.kr/build/mobile/image/single/gnb/logo_fashionsquare_white.png" alt="패션스퀘어" height="20" class="image" /></a></h1></div><div class="box__header-menu"><button type="button" class="button__search" data-montelena-acode="200004337" data-montelena-type="0"><span class="for-a11y">검색</span></button><a href="//cart.gmarket.co.kr/ko/m/cart" class="link__cart" data-montelena-acode="200004339" data-montelena-type="0"><span class="for-a11y">장바구니</span></a></div></div></div></div>
        </div>
    )

}
export default Header;
